"title": "Gift W/Order!  A Breath of Fresh Stationair by YesUMay!",
"announcement": "FOR A LIMITED TIME!! All Valentine orders receive free glitter drenched gift tags along with any Valentine related order of any size now until February 14!!!!! Cheers!\r\n\r\nRemember, if you are making a purchase for an event, please list the event type and date in the notes to seller during checkout to ensure your goodies arrive on time!!!  \r\n\r\nAlso, please be sure to visit my shop policies before purchase so we may be sure everyone is clear and content!     ....happy shopping!!\r\n.\r\n.\r\n.\r\n.\r\n.\r\nFollow me on twitter for coupons and giveaways! Http://twitter.com/yumstationery .  Delivery outside the U.S. is totally available, just get in touch with me and we&#39;ll calculate shipping!\r\n\r\n☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*\r\n\r\nWEDDING STATIONERY ORDERS RECEIVE 10% OFF ENTIRE PURCHASE!\r\n\r\n☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*☼*\r\n\r\nDid you know that if you have an invitation or stationery design you like, we can recreate almost ANY design usually for less than the cost of the original!  Slashed price, exact same quality-(Or better-we have superior laser printing capabilities!) Simply send me a picture or link to your favorite style and we&#39;ll make your dream come true for less!\r\n_____________________________________________________________\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Im temporarily hospitalized with preterm labor with my twins!  \r\n\r\nPlease know that I will complete all orders made prior to my absence.\r\n\r\nThanks for coming by my shop! Please contact me directly if u need assistance.",
"sale_message": "Thanks, and please pleAAaase PLEAaaasE enjoy! &gt;:)",
"digital_sale_message": null,
"last_updated_tsz": 1421805471,
"listing_active_count": 158,
"login_name": "YesUMaystationery",
"accepts_custom_requests": true,
"policy_welcome": "I make each and every piece of handmade, originally designed, unheardof-ly unique artwork with quality, precision, and with an eye for perfection. I intend to be as cost aware for you as if I had to buy it myself.  I intend to turn paper into love, and add glitz and glitter to anything possible!",
"policy_payment": "I accept paypal.  I prefer bill to be satisfied upfront for gift items and a deposit of 50% upon order for custom stationery, and the rest upon last proof approval.  \r\n\r\n//////\\\\\\\\\\\\Should you decide to cancel an order, cancellation should be given no later than 24 hours after initial order. Any request to cancel order received after 24 hours may be subject to a restocking fee, and custom orders are not subject to cancel past the first 12 hours/////////\\\\\\\\\\\\\\\\\\\r\n\r\nI prefer to have guest lists and menus asap after ordering or figure a half a day per guest prior to SHIPPING DEADLINE if that&#39;s the earliest you can get it to me.  \r\n\r\nExample: if there are 10 guests I need lists no later than 5 days prior to SHIPPING DEADLINE.  if there are 20 guests I need lists no later than 10 days prior to SHIPPING DEADLINE, and so on.",
"policy_shipping": "Each order placed is given a lead time and you should coordinate lead time with shipping deadline. Shipping deadline should be 7-10 days before YOU need them. \r\nExample: You order 300 invitations. I give you a lead time of 6 days. You should figure six days PLUS shipping time of 7-10 days to arrive, which should be 7-10 days before you need them. In this case, if your wedding is the 30th, you should place order on the 2nd-5th.\r\n\r\n***If you have already passed your deadline, please contact me personally so we may expedite your order***\r\n\r\nI use USPS priority flat rate shipping whenever possible, except on the initial purchase of a sample which is shipped first class. However, if you have a preference, I have no prejudice. It depends on what YOU want to pay for! Insurance is available, expediting is available. Please contact me to figure charges on anything above priority requests or for international shipping.",
"policy_refunds": "I do not refund customized items or stationery, although I certainly aim to please and will respect and consider any issue brought forth.  \r\n\r\nAt this time I do not accept refunds. If you are unhappy with your order, you may return it and I will rectify the issue by either repairing or replacing your original order.  If it is irreplaceable, exchanges may be given WITHIN 7 DAYS OF RECEIPT OF GOODS!!!!\r\n\r\nSales/discounts/promotions are NOT to be used in conjunction with each other unless otherwise stated. Clearance items are not subject to refunds or exchanges.",
"policy_additional": "My deepest desire is to say YES U MAY as much as possible...after all it&#39;s the name of my company!  If you don&#39;t see it, ask for it.  I&#39;ll do my best to make your sparkliest wish come true!  WOOHOO ETSY!!!!\r\n\r\n*************************************************\r\n\r\nI am not walmart. i am an exclusive, custom handmade artist.  All materials and designs are subject to availability which is subject to change with or without notice.  In the case that your custom request is unable to be furnished because of a change in availability, I will substitute similar ingredients to complete your order.  ",
